import React from 'react';
import './OWOrders.css';
import axios from 'axios';

class openOrders extends React.Component {
    constructor() {
        super()
        this.state = {
            ticketTitle: [],
            unitNum: [],
            ticketBody: []
        }

    }
    // use axios for getting Open workers that are open
    findOrder() {
        return axios.get("/OpenWorkOrder/" + this.state.unitNum);
    }

    render() {
        return (
            <form>

                <input className='unitNumber' placeholder='Unit Number' value={this.state.unitNum} onChange={e => this.setState({ unitNum: e.target.value })} />
                <br />
                <input type="submit" value="Submit" onClick={(e) => { e.preventDefault(); this.findOrder() }} />
            </form>
        );
    }
}

export default openOrders;
